import React from 'react'
import { Row, Col } from 'react-bootstrap'
import Product from '../../components/Product'

import SHOP_DATA from '../../shop.data'

const ShopPage = () => {
  return (
    <div>
      <h1>Latest Products</h1>
      <Row>
        {SHOP_DATA.map((shop) => (
          <Col sm={12} md={6} lg={4} xl={3}>
            <Product shop={shop} />
          </Col>
        ))}
      </Row>
    </div>
  )
}

export default ShopPage
